import React from 'react';
import {
  Link,
} from 'react-router-dom';
import RayaLogo from 'assets/media/raya-logo.svg';
import { useDispatch } from 'react-redux';
import { logout } from 'features/auth/authSlice';

const NavBar = () => {
  const dispatch = useDispatch();

  return (
    <div className="raya-navbar box has-background-white has-text-primary-dark">
      <img className="raya-logo" src={RayaLogo} alt="raya-logo" />
      <hr className="has-background-primary-dark"/>
      <div>
        <Link to="/dashboard/experiments">
          <button type="button" className="button is-fullwidth is-rounded is-info link">
            <span className="icon is-large">
              <i className="fas fa-lg fa-user-clock" />
            </span>
            <div>&nbsp;Experiments</div>
          </button>
        </Link>
        <hr className="has-background-primary-dark"/>
        <button type="button" onClick={() => dispatch(logout())} className="button is-primary is-fullwidth is-rounded is-dark link">
          <span className="icon is-large">
            <i className="fas fa-lg fa-power-off" />
          </span>
          <div>&nbsp;Logout</div>
        </button>
      </div>
    </div>
  );
};

export default NavBar;
